import React, { useState } from 'react';
import Userdashbord from '../dashbord/Userdashbord'
import Packages from '../dashbord/Packages';
import Profile from '../dashbord/Profile';
import ServiceHead from '../components/homepage/ServiceHead' 


import { FaUser,FaShoppingCart, FaUserCircle, FaThList } from 'react-icons/fa';

function UserPanel() {
    const [currentPage, setCurrentPage] = useState('user');

    const handlePageChange = (page) => {
        setCurrentPage(page);
    };

    return (
        <div className='flex bg-gray-900'>
            {/* slide bar */}
            <div className='w-1/6 h-screen p-4 bg-gray-800'>
                <h2 className='mb-4 flex items-center font-bold text-lg text-white'>
                    <FaThList className='mr-2' />
                    Dashboard
                </h2>
                <ul>
                    <li
                        className={`flex p-4 rounded-full items-center cursor-pointer text-white hover:bg-gray-700 ${currentPage === 'user' ? 'bg-orange-500 hover:bg-orange-600' : ''}`}
                        onClick={() => handlePageChange('user')}
                    >
                        <FaUser className='mr-2' />
                        Order Foods
                    </li>
                    <li
                        className={`flex p-4 rounded-full items-center cursor-pointer text-white hover:bg-gray-700 ${currentPage === 'packages' ? 'bg-orange-500 hover:bg-orange-600' : ''}`}
                        onClick={() => handlePageChange('packages')}
                    >
                        <FaShoppingCart className='mr-2' />
                        Packages
                    </li>
                    <li
                        className={`flex p-4 rounded-full items-center cursor-pointer text-white hover:bg-gray-700 ${currentPage === 'profile' ? 'bg-orange-500 hover:bg-orange-600' : ''}`}
                        onClick={() => handlePageChange('profile')}
                    >
                        <FaUserCircle className='mr-2' />
                        Profile
                    </li>
                </ul>
            </div>
            <div className='flex-1 p-1'>
                {currentPage === 'user' && <Userdashbord />}
                {currentPage === 'packages' && <Packages />}
                {currentPage === 'profile' && <Profile />}
            </div>
        </div>
    );
}

export default UserPanel;
